        public static int[] ThreeEqualParts(int[] arr) {
            // copied solution becaus doesn't accept mine
            var fail = new int[] {-1,-1};
            var ones =0;
            foreach(int i in arr)
                ones += i;
            if (ones % 3 != 0)
                return fail;
            if (ones / 3 == 0)
                return new int[] {0, arr.Length-1};

            int i1 = -1, j1 = -1, i2 = -1, j2 = -1, i3 = -1, j3 = -1;
            int su = 0;
            int T = ones / 3;
            for (int i = 0; i < arr.Length; ++i) {
                if (arr[i] == 1) {
                    su += 1;
                    if (su == 1) i1 = i;
                    if (su == T) j1 = i;
                    if (su == T+1) i2 = i;
                    if (su == 2*T) j2 = i;
                    if (su == 2*T + 1) i3 = i;
                    if (su == 3*T) j3 = i;
                }
            }

            // The array is in the form W [i1, j1] X [i2, j2] Y [i3, j3] Z
            // where [i1, j1] is a block of 1s, etc.
            int[] part1 = new int[j1+1-i1];
            int[] part2 = new int[j2+1-i2];
            int[] part3 = new int[j3+1-i3];

            Array.Copy(arr,i1,part1,0,j1+1-i1);
            Array.Copy(arr,i2,part2,0,j2+1-i2);
            Array.Copy(arr,i3,part3,0,j3+1-i3);
            if (!Enumerable.SequenceEqual(part1, part2)) return fail;
            if (!Enumerable.SequenceEqual(part1, part3)) return fail;

            // x, y, z: the number of zeros after part 1, 2, 3
            int x = i2 - j1 - 1;
            int y = i3 - j2 - 1;
            int z = arr.Length - j3 - 1;

            if (x < z || y < z) return fail;
            return new int[]{j1+z, j2+z+1};
        }

        public static int[] ThreeEqualPartsBruteForce(int[] arr) {
            int first = 0;
            int last = arr.Length-1;
            
            while (first < last) {
                int sumA = Sum(arr,0, first);
                int sumB = 0;
                int sumC = Sum(arr, last, arr.Length-1);
                if(sumA == sumC) {
                    //to avoid sum if not needed
                    sumB = Sum(arr, first+1, last-1);
                    if (sumA == sumB)
                        return new int[] {first, last};
                    if (sumB > sumC)
                        last--;
                    else if (sumA < sumB)
                        first++;
                    if (sumB < sumC || sumB < sumA)
                        break;
                }
                else if (sumC < sumA) {
                    last--;
                }
                else {
                    first++;
                }
            }
            return new int[] {-1,-1};
        }
    
        private static int Sum(int[] arr, int start, int end) {
            int result = 0;
            for(int i = end; i >= start; i--){
                result += arr[i]*(end-i+1);
            }
            return result;
        }
